ike swimming free of cost if membership fee is paid?',0,NULL,'2016-05-15 14:42:14','2016-05-15 14:42:14'),(19,'Not able to place order ','ashish.sadh007@gmail.com',0,'Home Page is down. ',0,NULL,'2016-05-24 14:18:56','2016-05-24 14:18:56'),(20,'Regarding Membership','shettyanvitatech@gmail.com',271,'Unable to pay online for membership. kindly confirm how can i pay online & also help me with your contact details & address over the mail.',0,NULL,'2016-07-26 15:28:01','2016-07-26 15:28:01'),(21,'Cheap goods','johnd100@gmail.com',0,'Wow! This could be one particular of the most useful blogs We\'ve ever arrive across on this subject. Basically Wonderful. I\'m also a specialist in this topic so I can understand your hard work. ffbffkdaaked',0,NULL,'2016-08-19 11:09:33','2016-08-19 11:09:33'),(22,'Cheap goods','johnb377@gmail.com',0,'Appreciating the time and energy you put into your blog and in depth information you provide. It\'s good to come across a blog every once in a while that isn\'t the same unwanted rehashed information. Excellent read! I\'ve saved your site and I\'m adding your RSS feeds to my Google account. facgkeecgede',0,NULL,'2016-08-19 11:09:39','2016-08-19 11:09:39'),(23,'John','smithf601@gmail.com',0,'Specifically where web can a certified psyciatrist submit content or sites for them to become fashionable? bddkeeedbkdbgadd',0,NULL,'2016-08-19 11:09:48','2016-08-19 11:09:48'),(24,'Want to join and need few details ','vprasad028@gmail.com',0,'Pls call on below number...I would like to know the details \r\n\r\n8886378080',0,NULL,'2016-08-27 17:29:43','2016-08-27 17:29:43'),(25,'Request for contact details to connect on partnering as a vendor for wellness activities','tcreado@deloitte.com',0,'Dear Hobbyix team,\r\n\r\nTrust this mail finds you well.\r\nI am a consultant at Deloitte USI S&O and part of the Flexibility and Predictability team focusing on wellness activities. I came across your website offering membership for a range of wellness and fitness activities across Hyderabad, and wanted to speak with you about potentially tying up with us as a vendor, so that we could encourage Deloitte USI S&O practitioners to sign up for the same. \r\n\r\nPlease let me know a suitable time to connect and your contact details. I look forward to speaking with you soon.\r\n\r\nThanks & Regards,\r\nThea\r\n\r\nThea Creado, MD\r\nStrategy & Operations\r\nDeloitte Consulting LLP\r\nMobile: +1 615 718 2102 / +91 99207 98007\r\ntcreado@deloitte.com | www.deloitte.com',0,NULL,'2016-09-08 15:03:30','2016-09-08 15:03:30'),(26,'Cheap goods','johng983@gmail.com',0,'Hey would you mind letting me know which web host you\'re working with? I\'ve loaded your blog in 3 completely different internet browsers and I must say this blog loads a lot faster then most. Can you suggest a good internet hosting provider at a fair price? Kudos, I appreciate it! dbfkdgeebggd',0,NULL,'2016-11-04 03:38:22','2016-11-04 03:38:22'),(27,'Cheap goods','johnb844@gmail.com',0,'A big thank you for your article.Really thank you! Cool. gebaabfcefkg',0,NULL,'2016-11-04 03:38:28','2016-11-04 03:38:28'),(28,'John','smithf156@gmail.com',0,'certainly like your website however you have to check the spelling on several of your posts. Many of them are rife with spelling problems and I to find it very troublesome to inform the truth nevertheless I will surely come back again. abfcddakddegddek',0,NULL,'2016-11-04 03:38:40','2016-11-04 03:38:40'),(29,'Active services?','aabhishekpatwari@gmail.com',279,'Dear Team Hobbyix,\r\n     				 I was looking for a membership for something flexible, that’s when I discovered Hobbyix. I really loved your concept and I am ready to take the plunge. Just tried reaching you over the phone and was informed that the number is disconnected. Also noticed that your last update on the Facebook page was 11th October. If your still in the game please let me know. I would love to try out your services. Also a few promo codes would be super cool. Thanks.\r\n\r\nRegards,\r\nAbhishek',0,NULL,'2016-11-28 13:24:37','2016-11-28 13:24:37'),(30,'Not able to pay','savarmehrotra444@gmail.com',281,'I want to start using your service but when I go to pay it takes me to page which gives me an error saying that I typed a wrong URL . How do I pay please help me out\r\n',0,NULL,'2016-12-06 17:34:12','2016-12-06 17:34:12');
